Thin Lizzy - Live and Dangerous (2007) DVD

This DVD that was released on October 16, 2007 contains all the recorded video from the Live and Dangerous concert (London and Toronto in 1977), including: (in order) &quot;Rosalie&quot;, &quot;The Boys Are Back In Town&quot;, &quot;Emerald&quot;, &quot;Dancing In The Moonlight&quot;, &quot;Massacre&quot;, &quot;Still In Love With You&quot;, &quot;Don't Believe A Word&quot;, &quot;Are You Ready&quot;, &quot;Sha-La-La&quot;, &quot;Baby Drives Me Crazy&quot;, and &quot;Me And The Boys&quot; (Not included on the album). It also includes various other Thin Lizzy performances, such as a recorded show from their farewell tour.

